extension.description.full.message:
PreMiD este un utilitar simplu, configurabil, care vă permite să arătați ce faceți pe web în starea dvs. de redare Discord.

De exemplu, când începeți să vizionați un videoclip pe YouTube, extensia noastră preia toate informațiile necesare din pagină și le trimite aplicației noastre, care apoi stabilește starea în profilul dvs. de Discord.

PreMiD acceptă peste 500 de site-uri web și funcționează în continuare datorită comunității sale puternice, care adaugă prezențe noi în fiecare zi.

Pentru a utiliza PreMiD, trebuie să adăugați această extensie și să instalați aplicația oficială PreMiD găsită pe site-ul nostru. Acest lucru se datorează constrângerilor din modul în care funcționează SDK-ul Rich Presence al Discord.

